import "./App.css";
import transactionList from "./components/transactionList";
import transactionForm from "./components/transactionForm";

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h3>Hello React.</h3>
          <transactionList />
          <transactionForm />
        </header>
      </div>
    );
  }
}

export default App;
